import './App.css';
import Header from './components/Header';
import Navbar from './components/Nav';
import Home from './components/Home';
import Works from './components/Works';
import Services from './components/Services';
import Contact from './components/Contact';

import BoltIcon from '@mui/icons-material/Bolt';

function App() {
  return (
    <body className="scrollbar h-screen w-screen xl:px-60 lg:px-40 px-8 py-4 overflow-hidden bg-cover">

      <div className='scrollbar bg-black/80 backdrop-blur-sm h-full overflow-y-scroll rounded-lg text-whit  drop-shadow-md border text-sm md:text-base'>
        <div className='w-full bg-accent/95 rounded-t-lg text-center py-1 sticky top-0 z-50 text-xs'>
          <p className='font-semibold '>BRING YOUR VISIONS TO LIFE</p>
          <span className='absolute right-1 top-0 flex items-center animate-pulse'>
            <BoltIcon className='pl-1 icon text-green-500' />
            <p className='pr-1 hidden md:block'>Available for Hire</p>
          </span>
        </div>

        <div>
          <Header />

          <Navbar />

          <div className=''>
            <section id='0' className='border-t border-bg2'>
              <Home />
            </section>

            <section id='1' className='border-t border-bg2'>
              <Services />
            </section>

            <section id='2' className='border-t border-bg2'>
              <Works />
            </section>

            <section id='3' className='border-t border-bg2'>
              <Contact />
            </section>

          </div>
        </div>
      </div>

    </body>
  );
}

export default App;
